[include mainsail.cfg]
[include stealthburner_leds.cfg]
[include macros.cfg]
[include fans.cfg]
[include steppers.cfg]
[include bedHeater.cfg]
[include nitehawk.cfg]
[include beacon.cfg]

[exclude_object]

[gcode_arcs]
resolution: 0.1

[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32f446xx_15001F000D50535556323420-if00
restart_method: command

[temperature_sensor mcu_temp]
sensor_type: temperature_mcu
min_temp: 0
max_temp: 100

[temperature_sensor raspberry_pi]
sensor_type: temperature_host
min_temp: 10
max_temp: 100

[temperature_sensor Nitehawk]
sensor_type: temperature_mcu
sensor_mcu: nhk
max_temp: 100

[printer]
kinematics: corexy
max_velocity: 400 #Default 300
max_accel: 10000 #Default 5200
max_z_velocity: 15 #Max 15 for 12V TMC Drivers, can increase for 24V
max_z_accel: 350
square_corner_velocity: 5.0

#####################################################################
#   LED Control
#####################################################################
[output_pin caselight]
pin: PD15
pwm:true
shutdown_value: 0
value:.01
cycle_time: 0.01

#####################################################################
# 	Additional Sensors
#####################################################################
[temperature_sensor chamber_temp]
sensor_type: ATC Semitec 104NT-4-R025H42G
sensor_pin: PF4
min_temp: 0
max_temp: 100
gcode_id: chamber_th

#####################################################################
#   Homing and Gantry Adjustment Routines
#####################################################################
[idle_timeout]
timeout: 1800

[z_tilt]
z_positions:
   -50, 18
   150, 348
   350, 18
points:
   30, 5
   150, 245
   270, 5
speed: 300
horizontal_move_z: 10
retries: 5
retry_tolerance: 0.0075

########################################
# EXP1 / EXP2 (display) pins
########################################
[board_pins]
aliases:
    # EXP1 header
    EXP1_1=PE8, EXP1_2=PE7,
    EXP1_3=PE9, EXP1_4=PE10,
    EXP1_5=PE12, EXP1_6=PE13,    # Slot in the socket on this side
    EXP1_7=PE14, EXP1_8=PE15,
    EXP1_9=<GND>, EXP1_10=<5V>,

    # EXP2 header
    EXP2_1=PA6, EXP2_2=PA5,
    EXP2_3=PB1, EXP2_4=PA4,
    EXP2_5=PB2, EXP2_6=PA7,      # Slot in the socket on this side
    EXP2_7=PC15, EXP2_8=<RST>,
    EXP2_9=<GND>, EXP2_10=<5V>

########################################
# Bed Mesh
########################################
[bed_mesh]
speed: 350
horizontal_move_z: 2
mesh_min: 20, 20
mesh_max: 250, 250
fade_start: 0.6
fade_end: 10.0
probe_count: 50,50
algorithm: bicubic

########################################
# Input Shaping
########################################
[input_shaper]
shaper_type_x: mzv
shaper_freq_x: 74
damping_ratio_x: 0.060
shaper_type_y: mzv
shaper_freq_y: 46.6
damping_ratio_y: 0.049

########################################
# Shake N' Tune
########################################
[shaketune]
show_macros_in_webui: True
number_of_results_to_keep: 10

